import React, { Component } from 'react';

class Footer extends Component {
    render() {
        return (
            <div>
                <footer className="footer">
                    <div className="container">
                        <div className="text-center">
                            Copyright © 2018 Dashtreme Admin
        </div>
                    </div>
                </footer>
            </div>
        );
    }
}

export default Footer;
